    let fields = ["Unnamed: 0", "username", "label_id", "street_edge_id", "neighborhood", "label_type", "lat", "lng", "gsv_panorama_id", "time_created", "correct", "severity", "temporary", "tag_list", "description"];
    let aliases = ["Unnamed: 0", "username", "label_id", "street_edge_id", "neighborhood", "label_type", "lat", "lng", "gsv_panorama_id", "time_created", "correct", "severity", "temporary", "tag_list", "description"];
    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
    ,{"className": "foliumtooltip", "sticky": true});
                     
</script>
